import React from 'react'
import windows from './img/windows10.jpg'
import edge from './img/edge1.png'
import floder from './img/floder.png'
import win from './img/win.png'
import win1 from './img/win1.png'
import Layout from './Layout'
function App(){
  const click=()=>{
    var x=document.getElementById('layout');
    if(x.classList.contains('layout')){
      x.classList.remove('layout')

    }
    else{
      x.style.display='none'
    }
  }
  return(
    <>



    <section className='box'>
    <div id='layout'>
     <Layout />
   </div>
      <img src={windows} alt='windows'/>

   <footer className='box1'>
   <img src={win} alt='win' id='win' onClick={click}/>

    <input type='text' placeholder='Type here to search' id='txt1'/>
    <img src={win1} alt='win1' id='win1'/>

<img src={edge} alt='edge' id='edge'/>
<img src={floder} alt='floder' id='floder'/>


   </footer>
   </section>
   <footer>
     <div className='f1'>DELL</div>
   </footer>
  </>
  );

}
export default App;
